export default function ResultBar(props) {
  return (
    <div
      style={{
        height: "30px",
        width: props.width,
        position: "absolute",
        bottom: "10px",
        margin: "0px 50px",
        backgroundColor: "#A9AAA9",
      }}
    ></div>
  );
}
